function App() {
  return (
    <CartProvider>
      <FavoriteProvider> {/* Wrap everything with this */}
        <Router>
          <Routes>
            <Route
              path="/"
              element={
                <>
                  <Header />
                  <Welcome />
                  <HomePage />
                  <Products />
                  <AboutPage />
                  <ContactPage />
                </>
              }
            />
            <Route path="/cart" element={<Cart />} />
            <Route path="/favorites" element={<Favorites />} /> {/* Add this if you created Favorites page */}
          </Routes>
          <Footer />
        </Router>
      </FavoriteProvider>
    </CartProvider>
  );
}

export default A
